  return (
    <div>
      <Main />
    <>
      <Navbar/>
      <div className="container">
        <Routes>
          <Route path="/home" element={<Home />} />
          <Route path="/" element={<Login />} />
          <Route path="/shoes" element={<ShoesPage />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/cart" element={<Cart />} />
          <Route path="*" element={<ErrorPage />} />   
        </Routes>
      </div>
    </>  
    </div>
  );
}

export default App;
